script: |
  super -f text -I q8850.spq | sort > q8850.out

inputs:
  - name: q8850.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - 71 BETWEEN + ( + col0 ) * col0 + 60 AND ( - + CAST ( NULL AS INTEGER ) );
  - name: tab1

outputs:
  - name: q8850.out
    data: |
      51	14	96
      85	5	59
      91	47	68
